  updateTerminatedCompanyGracePeriod(id) {
    if ($('#terminateCompanyList').find('.error_field').length !== 0) {
      this.toastrService.error(this.translate.instant('uft.toaster.pleaseEnterValidValues'));
      return false;
    }
    let new_obj = []
    var request;
    new_obj = this.changedArray.map(function (json) {
      let x = {
        "gracePeriod": json.gracePeriod,
        "coKey": json.coKey
      };
      request = x
      return x;
    });
    this.hmsDataService.postApi(UftApi.updateCoGracePeriodUrl, request).subscribe(data => {
      if (data.code == 200 && data.status == "OK") {
        this.toastrService.success(this.translate.instant('uft.toaster.recordUpdatedSuccess'))
      } else if (data.code == 400 && data.status == "BAD_REQUEST" && data.hmsMessage.messageShort == "GRACE_PERIOD_CANNOT_BE_GREATER_THAN_365_DAYS") {
        this.toastrService.error(this.translate.instant('uft.toaster.gracePeriodCannotBeGreaterThan365Days'))
      } else if (data.code == 400) {
        this.toastrService.error(this.translate.instant('uft.toaster.recordNotUpdated'))
      } else if (data.code == 404) {
        this.toastrService.error(this.translate.instant('uft.toaster.recordNotUpdated'))
      } else {
        this.toastrService.error(this.translate.instant('uft.toaster.recordNotUpdated'))
      }
      this.getTerminateCompanyList();
    })
  }
  
