  /**
    * Function to export HTML to Word document
    * @param element(Table Id) 
    * @param filename 
    */
  downloadFile(element, filename = '') {
    var html = document.getElementById(element).innerHTML;
    var doc = new jsPDF();
    // quikcard new logo used with 200 reso.. 
    var imageData = 'data:image/png;base64, ';
    doc.addImage(imageData, 'PNG', 15, 7, 44, 12);
    const poppinsRegularData = require('../../../../assets/fonts/Poppins/Poppins-Regular.ttf'); // Adjust path as needed
    doc.addFont(poppinsRegularData, 'Poppins', 'normal');
    doc.setFont('Poppins', 'normal');
    var elementHandler = {
      '#ignorePDF': function (element, renderer) {
        return true;
      }
    };
    doc.fromHTML(
      html,
      15,
      25,
      {
        'width': 180, 'elementHandlers': elementHandler
      });
    const pageSize = doc.internal.pageSize;
    const pageWidth = pageSize.width ? pageSize.width : pageSize.getWidth();
    const pageHeight = pageSize.height ? pageSize.height : pageSize.getHeight();
    var footerImg = 'data:image/png;base64,';
    doc.addImage(footerImg, 'JPEG', 0, pageHeight - 25, 210, 25);
    doc.save(this.COMPANY_NAME + "_TERMINATION LETTER" + '.pdf');
  }

  getWriteOffPopup(selectedRowData, id, tablerow, type) {
    this.addWriteoffsForm(id, selectedRowData, type)
    if (type == 'REFUND') {
      if (selectedRowData.companyBalance != 0) {
        this.hmsDataService.OpenCloseModal('openWriteoffPopup')
      }
      if (parseFloat(selectedRowData.companyBalance) == 0 || parseFloat(selectedRowData.companyBalance) == 0.00) {
        this.toastrService.warning(this.translate.instant('uft.toaster.compWithZeroBal'))
      }
    } else if (type == 'ZeroBal') {
      this.letterToPlanAdmin(selectedRowData, type)
      if (type == "ZeroBal" && selectedRowData.companyBalance != 0) {
        this.toastrService.warning(this.translate.instant('uft.toaster.balanceShouldBeZero'))
      }
    } else {
      this.hmsDataService.OpenCloseModal('openWriteoffPopup')
    }
  }

  addWriteoffsForm(key, selectedData, type) {
    this.compKey = key
    this.compDescription = selectedData.mergedDescription
    this.uftKey = ""
    var effDate = selectedData.effectiveOn // it should be company effective date
    if (effDate) {
      var myDate = this.changeDateFormatService.formatDate(effDate)
      this.compEffDate = this.changeDateFormatService.convertStringDateToObject(myDate)
    } else {
      this.compEffDate = ''
    }
      if (type == 'REFUND') { // Log #1149: Zero Balance button functionality added here, Log #1172: ZeroBal type functionalty for popup removed as per client new feedback > type == 'ZeroBal']
      this.getBankAccountStatus(this.compKey)
      this.isRefundHeading = true
      this.isRefundForm = true
      this.showRefundBtn = true
      this.showAddPayeeLink = true
      this.transType = "80"
      this.refundFlowApi();
      this.addWriteoffForm.controls.entryDate.disable();
      this.addWriteoffForm.controls.companyEffectiveOn.disable();
      this.addWriteoffForm.controls.yearEndDate.disable();
      this.addWriteoffForm.controls.yearEndBalance.disable();
      this.addWriteoffForm.controls.standardPapAmount.disable();
      this.addWriteoffForm.controls.refundAmount.disable();
    } else {
      this.showAddPayeeLink = false
      this.isRefundHeading = false
      this.isRefundForm = false
      this.showRefundBtn = false
      this.planType = "Write offs (99)"
      this.transType = "99"
      this.addWriteoffForm.controls.transactionType.disable();
    }
    setTimeout(() => {
      this.showDatatable(this.compKey, [+this.transType]);
    }, 1000);
    this.addWriteoffForm.reset();
    this.addWriteoffForm.patchValue({
      'transactionDate': this.todayDate,
    })

    this.addWriteoffForm.patchValue({
      'transactionType': this.planType,
    })
    if (this.compKey) {
      this.addWriteoffForm.patchValue({
        "companyNameNo": this.compDescription
      })
      this.getViewOfCompCurrentBal(this.compKey).then(res => {
        this.addWriteoffForm.patchValue({
          "currentBalance": this.currentBal,
        })
      })
      this.addWriteoffForm.controls.companyNameNo.disable();
      setTimeout(() => {
        document.getElementById('wo_transAmt').focus();
      }, 400);
    } else {
      this.addWriteoffForm.patchValue({
        'transactionDate': this.todayDate,
      })
    }
    this.addWriteoffForm.controls.currentBalance.disable();
    this.getBankDetails(this.compKey)
  }

