  changeDateFormat(event, frmControlName, formName, currentDate = false) {
    if (event.reason == 2 && currentDate == true && (event.value == null || event.value == '')) {
      var validDate = this.changeDateFormatService.getToday();
      var ControlName = frmControlName;
      var datePickerValue = new Array();
      datePickerValue[ControlName] = validDate;
      this.addWriteoffForm.patchValue(datePickerValue)
    } else if (event.reason == 2 && event.value != null && event.value != '') {
      var obj = this.changeDateFormatService.changeDateFormat(event);
      var self = this
      if (obj == null) {
        self[formName].controls[frmControlName].setErrors({
          "dateNotValid": true
        });
        return;
      }
      var ControlName = frmControlName;
      var datePickerValue = new Array();
      datePickerValue[ControlName] = obj;
      this.addWriteoffForm.patchValue(datePickerValue);
    }
    if (event.reason == 2) {
      if (formName == 'bankAccountsForm') {
        this.bankAccountsForm.patchValue(datePickerValue);
      }
    }
    if (this.addWriteoffForm.value.transactionDate && this.compEffDate) {
      this.error = this.changeDateFormatService.compareTwoDates(this.compEffDate.date, this.addWriteoffForm.value.transactionDate.date);
      if (this.error.isError == true) {
        this.addWriteoffForm.controls['transactionDate'].setErrors({
          "transactionEffDateCheck": true
        });
      }
    }
  }

