  downloadLetter(element, filename = '') {
    var html = document.getElementById(element).innerHTML;
    var doc = new jsPDF();
    // quikcard new logo used with 200 reso.. 
    var imageData = 'data:image/png;base64,';
    doc.addImage(imageData, 'PNG', 15, 7, 44, 12);
    const poppinsRegularData = require('../../../../assets/fonts/Poppins/Poppins-Regular.ttf'); // Adjust path as needed
    doc.addFont(poppinsRegularData, 'Poppins', 'normal');
    doc.setFont('Poppins', 'normal');
    var elementHandler = {
      '#ignorePDF': function (element, renderer) {
        return true;
      }
    };
    doc.fromHTML(
      html,
      15,
      25,
      {
        'width': 180, 'elementHandlers': elementHandler
      });
    const pageSize = doc.internal.pageSize;
    const pageWidth = pageSize.width ? pageSize.width : pageSize.getWidth();
    const pageHeight = pageSize.height ? pageSize.height : pageSize.getHeight();
    // quikcard new footer used with 793 reso..
    var footerImg = 'data:image/png;base64,';
    doc.addImage(footerImg, 'JPEG', 0, pageHeight - 25, 210, 25);
    doc.save(this.COMPANY_NAME + "_TERMINATION LETTER" + '.pdf');
  }

