      var reportTitle = 'Termination Refunds'
      var requestParam = {};
      if (this.isFilterSearch) {
        var params = this.dataTableService.getFooterParams("terminateCompanyList")
        requestParam = {"start": 0, "length": this.dataTableService.totalRecords, "company": params[0].value, "terminationDate": params[1].value, "gracePeriod": params[2].value, "endOfGracePeriod": params[3].value, "companyBalance": params[4].value, "pendingFund": params[5].value, "availFund": params[6].value, "coStatus": params[7].value, 'paramApplication': paramApp }
      } else {
        requestParam = {
          'start': 0,
          'length': this.dataTableService.totalRecords,
          'paramApplication': paramApp,
          'company':'',
          'endOfGracePeriod': '',
          'gracePeriod': '',
          'pendingFund': '',
          'companyBalance': '',
          'availFund': ''
        }
      }
      /** End Narrow Search */
      var url = UftApi.getTerminationRefundUrl;
      /** End Narrow Search */
      this.hmsDataService.postApi(url, requestParam).subscribe(data => {
        if (data.code == 200 && data.status == 'OK') {
          var doc = new jsPDF('p', 'pt', 'a3');
          var columns = [
            { title: 'Company Name & No.', dataKey: 'mergedDescription' },
            { title: 'Termination Date', dataKey: 'terminationDate' },
            { title: 'Grace Period Days', dataKey: 'gracePeriod' },
            { title: 'End of Grace Period', dataKey: 'endOfGracePeriod' },
            { title: 'Company Balance', dataKey: 'companyBalance' },
            { title: 'Pending Claims Fund', dataKey: 'pendingFund' },
            { title: 'Available Balance', dataKey: 'availFund' },
            { title: 'Company Status', dataKey: 'coStatus' }
          ];
          this.showPageLoader = false;
          var rows = data.result.data;
          /** Start */
          var head = [];
          var body = [];
          var total = 0;
          let claimPaymentsByCardholderArray = [];
          for (var i in rows) {
            body.push({
              "mergedDescription": rows[i].mergedDescription,
              "terminationDate": rows[i].terminationDate != null ? this.changeDateFormatService.changeDateByMonthName(rows[i].terminationDate) : '', 
              "gracePeriod": rows[i].gracePeriod,
              "endOfGracePeriod": rows[i].endOfGracePeriod != null ? this.changeDateFormatService.changeDateByMonthName(rows[i].endOfGracePeriod) : '',
              "companyBalance": this.currentUserService.convertAmountToDecimalWithDoller(rows[i].companyBalance),
              "pendingFund": this.currentUserService.convertAmountToDecimalWithDoller(rows[i].pendingFund),
              "availFund": rows[i].availFund,
              "coStatus": rows[i].coStatus
            });
          }
  
          let date = this.changeDateFormatService.changeDateByMonthName(this.changeDateFormatService.convertDateObjectToString(this.changeDateFormatService.getToday()) || '');
          //Start Header
          var headerobject = [];
          headerobject.push({
            'gridHeader1': reportTitle,
            'text5Date': date
          });
          this.pdfHeader(doc, headerobject);
          //End Header 
          doc.autoTable(columns, body, {
            styles: { overflow: 'linebreak', cellWidth: 'auto', fontSize: 8 },
            columnStyles: {
              "mergedDescription": { halign: 'left' },
              "terminationDate": { halign: 'right' },
              "gracePeriod": { halign: 'right' },
              "endOfGracePeriod": { halign: 'right' },
              "companyBalance": { halign: 'right' },
              "pendingFund": { halign: 'right' },
              "availFund": { halign: 'right' },
              "coStatus": { halign: 'right' }
            },
            headStyles: {
              fillColor: [255, 255, 255],
              textColor: [0, 0, 0],
              lineColor: [215, 214, 213],
              lineWidth: 1,
            },
            didParseCell: function (data) {
              if (data.section == 'head' && data.column.index != 0) {
                data.cell.styles.halign = 'right';
              }
            },
            startY: 100,
            startX: 40,
            theme: 'grid',
          });
  
          this.pdfFooter(doc);
          doc.save(reportTitle.replace(/\s+/g, '_') + '.pdf');
        } else if (data.code == 404 && data.status == 'NOT_FOUND') {
          this.showPageLoader = false;
          this.toastrService.error(this.translate.instant('uft.toaster.recordNotFound'));
        }
      });
