    // Excel button functionality
    exportTerminationRefundList() {
    var paramApp = this.currentUserService.getApplicationNameByRoleKey(+this.currentUserService.applicationRoleKey);
    if (this.dataTableService.totalRecords != undefined) {
      var URL = UftApi.generateTerminRefundExcelUrl;
      var reqParam
      if (this.isFilterSearch) {
        var params = this.dataTableService.getFooterParams("terminateCompanyList")
        reqParam = {"start": 0, "length": this.dataTableService.totalRecords, "company": params[0].value, "terminationDate": params[1].value, "gracePeriod": params[2].value, "endOfGracePeriod": params[3].value, "companyBalance": params[4].value, "pendingFund": params[5].value, "availFund": params[6].value, "coStatus": params[7].value, 'paramApplication': paramApp }
      } else {
        reqParam = {
          'paramApplication': paramApp,
          'start': 0,
          'length': this.dataTableService.totalRecords
        }
      }
      if (this.dataTableService.totalRecords > this.currentUserService.maxLengthForExcel) {
        this.exDialog.openConfirm(this.translate.instant('common.greaterThanMaxMsg')).subscribe((value) => {
          if (value) {
            this.exportFile(URL, reqParam);
          }
        });
      } else if (this.dataTableService.totalRecords > this.currentUserService.minLengthForExcel && this.dataTableService.totalRecords <= this.currentUserService.maxLengthForExcel) {
        this.exDialog.openConfirm(this.translate.instant('common.greaterThanMinAndLessThanMaxMsg')).subscribe((value) => {
          if (value) {
            this.exportFile(URL, reqParam);
          }
        });
      } else {
        this.exportFile(URL, reqParam);
      }
    } else {
      this.toastrService.error(this.translate.instant('uft.toaster.recordNotFound'));
    }
  }

  exportFile(URL, reqParamPlan) {
    this.showPageLoader = false
    this.loaderPlaceHolder = "Loading File....."
    this.hasImage = true
    this.imagePath = []
    this.docName = ""
    this.docType = ""
    this.hmsDataService.postApi(URL, reqParamPlan).subscribe(data => {
      if (data.code == 200 && data.status == "OK") {
        this.loaderPlaceHolder = ""
        let docType = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'
        let imagePath = data.result
        if (data.hmsMessage.messageShort != 'EXCEL_REPORT_INPROGRESS') {
          this.loaderPlaceHolder = ""
          let docType = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'
          let imagePath = data.result
          var blob = this.hmsDataService.b64toBlob(imagePath, docType);
          const a = document.createElement('a');
          document.body.appendChild(a);
          const url = window.URL.createObjectURL(blob);
          a.href = url;
          let todayDate = this.changeDateFormatService.convertDateObjectToString(this.changeDateFormatService.getToday())
          var fileName = "Termination-Refunds"
          a.download = fileName + todayDate
          a.click();
          setTimeout(() => {
            window.URL.revokeObjectURL(url);
            document.body.removeChild(a);
          }, 0)
        }
      } else {
        this.toastrService.error(this.translate.instant('uft.toaster.recordNotFound'));
      }
    })
  }

  //Log #1151: Letter to Plan Admin At End Of Grace Period-SURPLUS(3a), DEFICIT(3b) and ZERO BALANCE(3c)[17-Jun-2024]
  getPlanAdminLetterContent(selectedRowData, buttonType = null) {
    let request = {
      "coKey" : selectedRowData.coKey,
      'gracePeriod': selectedRowData.gracePeriod,
      'companyBalance': selectedRowData.companyBalance,
      'coContactFirstName': this.COMPANY_PRIMARY_CONTACT_FIRST_NAME, 
      'coContactLastName': this.COMPANY_PRIMARY_CONTACT_LAST_NAME, 
    }
    if (buttonType == 'REFUND') {
      request['ltrStatus'] = 'IR'
    } else if (buttonType == 'IssueState') {
      request['ltrStatus'] = 'IS'
    } else if (buttonType == 'Writeoff') {
      request['ltrStatus'] = 'WO'
    } else if (buttonType == 'ZeroBal') {
      request['ltrStatus'] = 'ZB'
    }
    this.hmsDataService.postApi(UftApi.paTerminLetterUrl, request).subscribe(data => {
      if (data.code == 200 && data.status == "OK") {
        if (data.result.paLetterFilePath != undefined && data.result.paLetterFilePath != "") {
          window.open(data.result.paLetterFilePath, '_blank');
        }
      } else if (data.code == 400 && data.hmsMessage.messageShort == 'COMPANY_NO_IS_MISSING') {
          this.toastrService.error('Company No. Is Missing!!')
      } else {
        this.toastrService.error(this.translate.instant('uft.toaster.letterNotGenerated'))
      }
    },(error) => {
      this.toastrService.error(this.translate.instant('uft.toaster.letterNotGenerated'))
    })
  }

